import React from 'react'
import { Route, Switch } from 'react-router-dom'
import MovieContainer from './MovieContainer'

class MainContainer extends React.Component {
    render() {
        return (
            <Switch>
                <Route to='/movies' exact render={ (routerProps) =>
                    <MovieContainer />
                }/>
            </Switch>
        )
    }
}
